            // </li>
            <p>{item.text}</p>
        )
    }
    render() {
        const todoEntries = this.props.entries
        const itemList = todoEntries.map(this.createTask)
        return (
            <div className="list">
                {/* <ul>{itemList}</ul> */}
                {itemList}
            </div>
        )
    }
}
